                <th>Id</th>
                <th>Email</th>
                <th>Roles</th>
                <th>Password</th>
                <th>Nom_user</th>
                <th>Prenom_user</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
                <td>{{ user.password }}</td>
                <td>{{ user.NomUser }}</td>
                <td>{{ user.PrenomUser }}</td>
                <td>
                    <a href=\"{{ path('app_users_show', {'id': user.id}) }}\">show</a>
                    <a href=\"{{ path('app_users_edit', {'id': user.id}) }}\">edit</a>
                </td>
            </tr>
